[Det, er, i, Norge, ikke, vanlig, at, en, organisasjon, ,, et, forbund, eller, et, enkeltindivid, gir, ut, opplysningsskrifter, om, sine, saker, ., Norges, Husmorforbund, har, likevel, utgitt, flere, slike, brosjyrer, opp, gjennom, årene, ., Den, første, var, «, Mat, for, barn, », ,, som, kom, ut, i, 1949, ,, og, som, senere, gikk, under, navnet, «, Barnas, egen, kokebok, », ., Siden, er, det, kommet, nye, titler, om, barn, oppigjennom, årene, ,, og, alle, utgitt, i, et, opplag, som, må, sies, å, være, meget, stort, ., Disse, brosjyrene, tar, for, seg, emner, som, spenner, fra, stell, av, de, første, tennene, til, matlaging, for, store, forsamlinger, ., Dette, er, da, også, blitt, husmorens, håndbok, i, en, rekke, praktiske, og, nyttige, situasjoner, vi, har, i, vårt, daglige, liv, ., 
, I, de, år, vi, har, bak, oss, har, samfunnet, gjennomgått, en, sterk, utvikling, ., Vi, har, fått, mer, fritid, og, penger, til, hjemmene, ,, flere, tekniske, hjelpemidler, har, overtatt, strevet, med, tungt, arbeid, ,, og, nye, arbeidsplasser, har, grodd, frem, i, tilknytning, til, hjemmeindustri, og, småindustri, ., Til, en, viss, grad, har, vel, dette, også, endret, våre, prioriteringer, ., 
